import React from 'react';
import ReactDOM from 'react-dom';

import online_experience_1_Image_path from "./images/katie-zaferes.png";
import online_experience_2_Image_path from "./images/Wedding_Photography.png";
import online_experience_3_Image_path from "./images/Mountain_Biking.png";

export default function Card() {
    return (
      <main>
        <section className="grid--experiences">
          <div className="grid--flex">
            <img src={online_experience_1_Image_path} className="experience--photo" />
            <img src={online_experience_2_Image_path} className="experience--photo" />
            <img src={online_experience_3_Image_path} className="experience--photo" />
          </div>
          <h2 className="grid--subtitles">Life lessons with Katie Zaferes 3:22</h2>
          <h2 className="grid--subtitles">Learn wedding photography</h2>
          <h2 className="grid--subtitles">Group Mountain Biking</h2>
        </section>
      </main>
    )
  }
